import Head from 'next/head';
import Main from '../components/containers/main';
import Sidebar from '../components/containers/sidebar';
import { getAllRulesData as getAllAssistantData } from '../utils/rules';
import { CoreAssistantDTO } from '../statics/definitions.dto';

export const getStaticProps = async () => {
  const allAssistantData = await getAllAssistantData();
  return {
    props: {
      allRulesData: allAssistantData
    }, // will be passed to the page component as props
  }
}

export default function Home({ allRulesData }: { allRulesData: CoreAssistantDTO[] }) {

  return (
    <>
      <Head>
        <title>Create Sketch Assistant</title>
      </Head>
      <div style={{ display: 'flex' }}>
        <Sidebar />
        <Main />
      </div>
    </>
  )
}
